create table npcs_items
(
    NpcShopId    int               null,
    CustomPrice  int               null,
    BuyCriterion mediumtext        null,
    MaxStats     tinyint default 0 not null,
    Id           int auto_increment
        primary key,
    ItemId       int               null,
    Type         varchar(255)      null,
    Level        int               null
)
    engine = MyISAM
    charset = utf8;

